27 september 2024
  Swedbanks årsstämma kommer att hållas i Stockholm torsdagen den 27 mars 2025. Valberedningen består av följande ledamöter: 
Lennart Haglund, utsedd Sparbankernas Ägareförening, tillika valberedningens ordförande; 
Ylva Wessén, utsedd av Folksam; 
Anders Oscarsson, utsedd av AMF; 
Annette Björkman, utsedd av ägargruppen Sparbanksstiftelserna; 
Magnus Tell, utsedd av Alecta Tjänstepension; 
Göran Persson, styrelseordförande Swedbank AB (publ). Valberedningens uppdrag är att bereda och lämna förslag till årsstämman 2025 om val av ordförande vid årsstämman, ledamöter och ordförande i styrelsen, samt revisor. Valberedningen kommer även att lämna förslag till antalet styrelseledamöter, arvode till styrelse och revisor, principer för hur valberedning inför årsstämman 2026 ska utses, samt instruktion för valberedningen avseende arbete inför årsstämman 2026. Aktieägare som vill lämna förslag till valberedningen ska göra detta senast den 8 januari 2025, antingen via e-post ti

27 september 2024 The Annual General Meeting of Swedbank AB will be held in Stockholm Thursday 27 March 2025. The members of the Nomination Committee are: 
Lennart Haglund, appointed by Sparbankernas Ägareförening and Chair of the Nomination Committee; 
Ylva Wessén, appointed by Folksam; 
Anders Oscarsson, appointed by AMF; 
Annette Björkman, appointed by the owner-group Sparbanksstiftelserna; 
Magnus Tell, appointed by Alecta Tjänstepension; 
Göran Persson, Chair of the Board of Directors of Swedbank AB (publ). The Nomination Committee is assigned to prepare and present proposals to the 2025 AGM regarding the election of Chair of the AGM, members and Chair of the Board of Directors, and external auditor. The Nomination Committee will also make proposals regarding the number of board members, remuneration to the board members as well as external auditor’s fee. Furthermore, proposals for principles on how the Nomination Committee for AGM 2026 shall be appointed and instruction for the N
